height: 630px; background-image: /*savepage-url=https://assets.ajio.com/medias/sys_master/images/images/h7c/h9e/16039744536606/Desktop.jpg*/ var(--savepage-url-11); margin-top: 35px; background-repeat: no-repeat; background-position-x: center;" data-ga-event-category="bannerTap" data-ga-event-action="DefaultCategoryBannerClicked" data-ga-event-label="DefaultPageBanner" class="home-page-banner"><div class="div-logo"><div class="col"><img data-savepage-src="https://assets.ajio.com/static/img/ajio_beige.png" src="data:image/webp;base64," class="logo-home"></div></div><div class="text-home">Who do you want to shop for?</div><div><div class="row-btn-cat-nav"><div><a href="/shop/women" class="no-outline zoom-hover" data-ga-event-category="firstCategorySelection" data-ga-event-action="buttonTap" data-ga-event-label="Women"><img data-savepage-src="https://assets.ajio.com/medias/sys_master/images/images/h55/h3a/10432181469214/women-first-pop-up-cta-white.jpg" src="data:image/webp;base64," class="btn-cat-nav img-animate"></a><a href="/shop/men" class="no-outline zoom-hover" data-ga-event-category="firstCategorySelection" data-ga-event-action="buttonTap" data-ga-event-label="Men"><img data-savepage-src="https://assets.ajio.com/medias/sys_master/images/images/haf/h24/10432181403678/men-first-pop-up-cta-white.jpg" src="data:image/webp;base64," class="btn-cat-nav img-animate"></a><a href="/shop/kids" class="no-outline zoom-hover" data-ga-event-category="firstCategorySelection" data-ga-event-action="buttonTap" data-ga-event-label="Kids"><img data-savepage-src="https://assets.ajio.com/medias/sys_master/images/images/h3b/hd0/10468934320158/KIDS-first-pop-up-cta-white.jpg" src="data:image/webp;base64," class="btn-cat-nav img-animate"></a><a href="/shop/sale" class="no-outline zoom-hover" data-ga-event-category="firstCategorySelection" data-ga-event-action="buttonTap" data-ga-event-label="Sale"><img data-savepage-src="https://assets.ajio.com/medias/sys_master/images/images/h26/hf5/11449881559070/shop-sale-CTA-desktop-intro.jpg" src="data:image/webp;base64," class="btn-cat-nav img-animate"></a></div></div></div></div></div></div><div class="main-footer "><footer><div class="ftr-top"><ul><li><span class="ic-update"></span><span>EASY EXCHANGE*</span></li><li><span class="ic-pikup"></span><span>100% HANDPICKED</span></li><li><span class="ic-qlty"></span><span>ASSURED QUALITY</span></li></ul></div><div class="ftr-cont"><div class="ftr-body"><div class="ftr-bodyinner"><div class="seo-dropdown"><div class="seo-dropdown-title">More about shopping from AJIO<span class="ic-Chevron-down"></span></div><div class="seo-dropdown-content close-seo"><h2>Buy Clothes, Footwear &amp; Fashion Online for Women, Men &amp; Kids | AJIO</h2><p>Ajio is a one stop online fashion destination brought to you from the house of Reliance. We are the largest fashion outlet in India - having <a href="http://storelocator.ril.com/reliancetrends/">15000+ stores</a> across 1000+ cities. At Ajio, you can browse &amp; buy a wide variety of carefully handpicked merchandise of highest quality from 500+ premium international brands, exclusive brands &amp; in-house brands at great prices. All of this can be done from the convenience of your home at the click/tap of a button.</p><h2>Buy clothes, footwear, jewellery &amp; accessories for Women Online</h2><p>Women can shop from a wide range of products for all kinds of occasions. For your office wear, you can buy formal shirts &amp; pants (or) pair <a href="/women-kurtas/c/830303011"> kurtas/tops</a> with jeans &amp; leggings. We have an exhaustive collection of indie-wear &amp; ethnic wear like churidars, <a href="/women-sarees/c/830303008"> sarees</a>, lehengas,  etc. to add to your festive occasions like Diwali, Holi, etc. For your party needs, we have fusion wear, party dresses, <a href="/women-jackets-coats/c/830316012">jackets</a>, shrugs, etc.</p><h2>Buy clothes &amp; footwear for Men Online</h2><p>On Ajio, men can find a wide variety of products. Make a style statement with trendy jeans &amp; pair them up with funky <a href="/men-tshirts/c/830216014">T-Shirts</a> &amp; Casual shirts. Head off to a party sporting the latest jackets/hoodies &amp; party-wear shirts. Have an active sports life? We have got you covered with gym wear, <a href="/men-track-pants/c/830216003">track pants</a>, track suits, etc. Having a family reunion? Bring out your trendiest ethnic Kurtas, Sherwanis &amp; Nehru Jackets.</p><h2>Buy clothes &amp; footwear for Kids &amp; Infants Online</h2><p>Get the latest clothing &amp; footwear for your kids of all ages - infants, boys &amp; girls. Ajio has many products for kids like jeans, gowns , shirts, <a href="/c/8311">toys</a>, infant wear, etc. Popular kids brands like Mini Klub, Peppermint, UCB Kids, Mothercare, etc feature among the best selling products for the kids. Our own brand <a href="/b/hamleys">Hamleys</a> provides a lot of toys for boys &amp; girls for all ages.</p><h2>Latest collections from Ajio</h2><p>Fashion &amp; lifestyle thrives on latest collections &amp; fresh merchandise. Taking cues from fast fashion, we have online collections to suit the current season &amp; trends - like floral prints, summer breeze, minimalists, etc. for Men &amp; Women.</p><h2>Why buy from us?</h2><p>Ajio offers the best hand-picked &amp; carefully selected products for the utmost satisfaction of the customers. Our talented in-house design team keeps track of the latest trends in Indian Fashion and Lifestyle &amp; designs products to suit the customer preferences. All our products are Made in India in fast fashion format, i.e. our in-house brands always have the freshest inventory. We offer free shipping &amp; 30-day easy returns all over the country. Didn’t like the product you received? We provide ‘No Questions Asked’ returns &amp; instant refunds.</p></div></div><section class="ftr-support"><div class="headline">AJIO</div><div class="ftr-items"><a href="https://www.ajio.com/help/whoweare" target="_self" title="Who We Are">Who We Are</a><a href="https://www.ajio.com/ajio-careers" target="_self" title="Join Our Team">Join Our Team</a><a href="https://www.ajio.com/help/termsAndCondition" target="_self" title="Terms & Conditions">Terms &amp; Conditions</a><a href="https://www.ajio.com/privacypolicy" target="_self" title="We Respect Your Privacy">We Respect Your Privacy</a><a href="https://www.ajio.com/fee-payment-promotion-policy" target="_self" title="Fees & Payments">Fees &amp; Payments</a><a href="https://www.ajio.com/return-refund-policy" target="_self" title="Returns & Refunds Policy">Returns &amp; Refunds Policy</a><a href="https://www.ajio.com/ajio-own-sale-policy" target="_self" title="Promotions Terms & Conditions">Promotions Terms &amp; Conditions</a></div></section><section class="ftr-support"><div class="headline">HELP</div><div class="ftr-items"><a href="https://www.ajio.com/my-account/orders" target="_self" title="Track Your Order">Track Your Order</a><a href="https://www.ajio.com/selfcare" target="_self" title="Frequently Asked Questions">Frequently Asked Questions</a><a href="https://www.ajio.com/selfcare" target="_self" title="Returns">Returns</a><a href="https://www.ajio.com/selfcare" target="_self" title="Cancellations">Cancellations</a><a href="https://www.ajio.com/selfcare" target="_self" title="Payments">Payments</a><a href="https://www.ajio.com/selfcare" target="_self" title="Customer Care">Customer Care</a><a href="https://www.ajio.com/coupon-faq" target="_self" title="How Do I Redeem My Coupon?">How Do I Redeem My Coupon?</a></div></section><section class="ftr-support"><div class="headline">SHOP BY</div><div class="ftr-items"><a href="https://www.ajio.com/capsule/newin" target="_self" title="Collections">Collections</a><a href="https://www.ajio.com/shop/men" target="_self" title="Men">Men</a><a href="https://www.ajio.com/shop/women" target="_self" title="Women">Women</a><a href="https://www.ajio.com/shop/kids" target="_self